Defendant in custody appearing from Kettle Moraine via zoom.   
State moves to delete the penalty enhancer on count 1.   Motion granted.    
Count 1 - Bail Jumping - No contest plea.    Convicted.   State moves to dismiss and read in counts 2 and 3.   Motion granted.   Sentence is withheld.   Defendant is placed on probation to DOC for eighteen (18) months consecutive to his initial confinement on Brown County Cases 20 CF 1740 and 21 CF 7, but concurrent with his extended supervision.   Conditions of probation are:
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
2) AODA assessment and follow through; 
3) Maintain absolute sobriety; 
4) Submit to random urine screens and pay for same; 
5) Maintain full-time employment/schooling combination; 
6) Pay costs of action; 
7) Pay supervision fees in an amount to be determined by DOC; 
8) Submit DNA sample.   
Defendant has 2 days sentence credit.   
Minutes.
